window.bookSummaryJSON = "<p><b><i>New York Times </i></b><b>Best Seller â€¢ The heroes of the High Republic era return to face a shattered peace and a fearsome foe, following the dramatic events of </b><b><i>Light of the Jedi</i></b><b>.</b></p> <p>In the wake of the hyperspace disaster and the heroism of the Jedi, the Republic continues to grow, bringing more worlds together under a single unified banner. Under the leadership of Chancellor Lina Soh, the spirit of unity extends throughout the galaxy, with the Jedi and the newly established Starlight Beacon station at the vanguard.</p> <p>In celebration, the chancellor plans the Republic Fair, a showcase of the possibilities and the peace of the expanding Republic - a peace the Jedi hope to foster. Stellan Gios, Bell Zettifar, Elzar Mann, and others join the event as ambassadors of harmony. But as the eyes of the galaxy turn toward the fair, so too does the fury of the Nihil. Their leader, Marchion Ro, is intent on destroying this unity. His storm descends on the pageantry and celebration, sowing chaos and exacting revenge.</p> <p>As the Jedi struggle to curb the carnage of the rampaging Nihil, they come face-to-face with the true fear their enemy plans to unleash across the galaxy - the kind of fear from which even the Force cannot shield them.</p>"; 
